import '../styles/navbar.css';

export default class Navbar extends React.Component {
    constructor(props) {

        super(props)
        const tabs = ['Home', 'About']


        this.state = {
          selectedLanguage: 'All'
        }

        this.updateLanguage = this.updateLanguage.bind(this)
      }



    render(){    
    return (
            <ul className='navbar'>{tabs.map((tab) => (
                <li key={tab}>
                    <button>{tab}</button>
                    </li>
            ))}</ul>

    )
}
}
